CREATE TABLE SGDTEST.TVS_MUNICIPIO
(
    IDE_MUNIC NUMBER(18) PRIMARY KEY NOT NULL,
    NOMBRE_MUNIC VARCHAR2(64) DEFAULT NULL
,
    COD_MUNIC VARCHAR2(8) DEFAULT NULL
,
    COD_DEPAR VARCHAR2(8) NOT NULL,
    ESTADO VARCHAR2(2) DEFAULT NULL
,
    FEC_CAMBIO TIMESTAMP(6),
    FEC_CREACION TIMESTAMP(6),
    COD_USUARIO_CREA VARCHAR2(20)
);
